import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Asegúrate de importar Routes
import Home from "./pages/home";
import DetailMeal from "./pages/DetailMeal/index"; // Asegúrate de que la ruta sea correcta

function App() {
  return (
    <Router> {/* Solo un Router aquí */}
      <div className="App">
        <Routes> {/* Cambia de Switch a Routes */}
          <Route path="/" element={<Home />} /> {/* Cambia a la nueva sintaxis */}
          <Route path="/meal/:idMeal" element={<DetailMeal />} /> {/* Cambia a la nueva sintaxis */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
